import React, { useEffect, useState } from "react";
import axios from "axios";
import {
  Box,
  Typography,
  Grid,
  CircularProgress,
  Paper,
  Divider,
} from "@mui/material";

const ComparePage = () => {
  const [car1, setCar1] = useState(null);
  const [car2, setCar2] = useState(null);
  const [loading, setLoading] = useState(true);
  const [analysis, setAnalysis] = useState("");

  const user = JSON.parse(sessionStorage.getItem("user"));
  const userId = user?.id;

  useEffect(() => {
    if (!userId) return;
    axios
      .get(`http://localhost:3030/api/comparison/${userId}`)
      .then((res) => {
        const dto = res.data;
        setCar1(dto.car2); // solda gösterilecek
        setCar2(dto.car1); // sağda gösterilecek
      })
      .catch((err) => {
        console.error("Failed to fetch comparison data:", err);
      })
      .finally(() => setLoading(false));
  }, [userId]);

  useEffect(() => {
    if (car1 && car2) {
      const a = [];

      if (car1.km !== car2.km) {
        const better = car1.km < car2.km ? car1 : car2;
        a.push(`${better.brand} ${better.model} has lower mileage.`);
      }

      if (car1.year !== car2.year) {
        const newer = car1.year > car2.year ? car1 : car2;
        a.push(`${newer.brand} ${newer.model} is a newer model.`);
      }

      if (car1.price !== car2.price) {
        const cheaper = car1.price < car2.price ? car1 : car2;
        a.push(`${cheaper.brand} ${cheaper.model} is more affordable.`);
      }

      if (a.length === 0) {
        a.push("Both vehicles are very similar.");
      }

      setAnalysis(a.join(" "));
    }
  }, [car1, car2]);

  const isNumeric = (val) => !isNaN(parseFloat(val)) && isFinite(val);

  const renderFeatureRow = (label, key) => {
    const val1 = car1?.[key] ?? "-";
    const val2 = car2?.[key] ?? "-";

    const highlight = (a, b, type = "default") => {
      if (!isNumeric(a) || !isNumeric(b)) return [false, false];
      const n1 = parseFloat(a);
      const n2 = parseFloat(b);
      if (type === "lowerBetter") return [n1 < n2, n2 < n1];
      if (type === "higherBetter") return [n1 > n2, n2 > n1];
      return [false, false];
    };

    let [h1, h2] = [false, false];
    if (key === "price" || key === "km") [h1, h2] = highlight(val1, val2, "lowerBetter");
    else if (isNumeric(val1) && isNumeric(val2)) [h1, h2] = highlight(val1, val2, "higherBetter");

    const textStyle = (highlighted) => ({
      fontWeight: highlighted ? "bold" : "normal",
      color: highlighted ? "#2e7d32" : "inherit",
      textAlign: "center",
    });

    return (
      <Grid container key={key} sx={{ py: 1 }}>
        <Grid item xs={4}>
          <Typography textAlign="left" fontWeight="bold">
            {label}
          </Typography>
        </Grid>
        <Grid item xs={4}>
          <Typography sx={textStyle(h1)}>{val1}</Typography>
        </Grid>
        <Grid item xs={4}>
          <Typography sx={textStyle(h2)}>{val2}</Typography>
        </Grid>
        <Grid item xs={12}>
          <Divider sx={{ my: 1 }} />
        </Grid>
      </Grid>
    );
  };

  if (loading) return <CircularProgress sx={{ m: 5 }} />;
  if (!car1 || !car2)
    return <Typography m={5}>Comparison data not available.</Typography>;

  return (
    <Box p={4}>
      <Typography variant="h4" gutterBottom textAlign="center">
        🚗 Vehicle Comparison
      </Typography>

      <Box textAlign="center" my={3}>
        <Grid container>
          <Grid item xs={4}></Grid>
          <Grid item xs={4}>
            <Typography variant="h6">
              {car1.brand} {car1.model}
            </Typography>
          </Grid>
          <Grid item xs={4}>
            <Typography variant="h6">
              {car2.brand} {car2.model}
            </Typography>
          </Grid>
        </Grid>
      </Box>

      {/* Karşılaştırma Tablosu */}
      <Paper elevation={2} sx={{ p: 3, mb: 4 }}>
        {renderFeatureRow("Price (₺)", "price")}
        {renderFeatureRow("Kilometers", "km")}
        {renderFeatureRow("Model Year", "year")}
        {renderFeatureRow("Fuel Type", "fuel")}
        {renderFeatureRow("Contact", "contact")}
      </Paper>

      {/* Akıllı Yorum */}
      <Paper elevation={2} sx={{ p: 3 }}>
        <Typography variant="h6" gutterBottom>
          🧠 Smart Analysis
        </Typography>
        <Typography>{analysis}</Typography>
      </Paper>
    </Box>
  );
};

export default ComparePage;
